(5, 'Cara Membuat Sertifikat Tanah, Dilengkapi Syarat dan Biayanya', '<p>Penulis Siti Maghfirah | Editor Siti Maghfirah JAKARTA, KOMPAS.com-&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;Sertifikat tanah merupakan bukti yang kuat dan autentik untuk menunjukkan kepemilikan suatu lahan. Oleh karena itu, sebaiknya pemilik segera mengurusnya dengan cara membuat sertifikat tanah (cara mengurus sertifikat tanah) berikut ini. Cara membuat sertifikat tanah sebenarnya cukup mudah dilakukan. Asalkan, Anda sudah memenuhi syarat membuat sertifikat tanah sebelum mengajukan pengurusan. Adapun cara mengurus sertifikat tanah bisa dilakukan melalui Kantor Badan Pertanahan Nasional (BPN) setempat, Baik secara mandiri maupun dengan bantuan PPAT. Lalu, bagaimana cara membuat sertifikat tanah? Berikut penjelasannya, beserta syarat membuat sertifikat tanah dan biaya membuat sertifikat tanah. Baca juga: Cara Cek Penerima Bansos PKH Tahap 2 lewat Website dan Aplikasi Syarat membuat sertifikat tanah Sebelum mengurus sertifikat tanah, persiapkan dulu dokumen berikut sebagai syarat-syaratnya: Foto kopi Kartu Tanda Penduduk (KTP) Foto kopi Kartu Keluarga (KK) pemohon sertifikat Foto Kopi Nomor Pokok Wajib Pajak (NPWP) Selain itu, pemilik juga perlu melampirkan data properti, yaitu: Bukti Izin Mendirikan Bangunan (IMB) untuk tanah yang ada bangunannya Akta Jual Beli (AJB), jika tanah diperoleh dari jual beli. Bukti pembayaran Pajak Penghasilan (PPh) Bukti pembayaran Bea Perolehan Hak atas Tanah dan Bangunan (BPHTB) Cara membuat sertifikat tanah (cara mengurus sertifikat tanah) secara mandiri Setelah dokumen persyaratan sudah siap, langkah selanjutnya adalah mengikuti tahapan mengurus sertifikat tanah. Berikut tahapan-tahapannya: Baca juga: Kartu ATM BSI Hilang? Ini Cara Blokir Kartu ATM BSI Online dan Offline 1. Mengunjungi Kantor BPN Langkah pertama, cara mengurus sertifikat tanah yaitu dengan mengunjungi kantor BPN sesuai dengan wilayah lokasi tanah. Setelah berada di kantor BPN, berikut langkah-langkahnya: Kunjungi loket pelayanan sertifikat tanah Ambil formulir pendaftaran dan lakukan verifikasi dokumen Kamu akan mendapatkan map dengan warna biru dan kuning Buatlah janji dengan petugas untuk mengukur tanah Kamu juga akan mendapatkan Surat Tanda Terima Dokumen (STT) dan Surat Perintah Setor (SPS) yang selanjutnya harus dibayarkan. Biaya pendaftaran yang harus dikeluarkan sekitar Rp 50.000. 2. Pengukuran lokasi Pengukuran ini dilakukan setelah berkas permohonan lengkap dan pemohon menerima tanda terima dokumen dari kantor pertanahan. Pengukuran dilakukan oleh petugas dengan ditunjukkan batas-batas oleh pemohon atau kuasanya. 3. Penerbitan Sertifikat Tanah Hak Milik Setelah pengukuran tanah, kamu akan mendapatkan data Surat Ukur Tanah. Serahkan surat tersebut untuk melengkapi dokumen yang telah ada. Setelah itu, kamu hanya tinggal menunggu dikeluarkannya surat keputusan. 4. Pembayaran Bea Perolehan Hak atas Tanah (BPHTB) Kamu akan dibebankan Bea Perolehan Hak Atas Tanah (BPHTB) sembari menunggu sertifikat tanah terbit. Lama waktu penerbitan ini kurang lebih setengah hingga satu tahun lamanya. Kadangkala, kamu perlu memastikan kepada petugas BPN kapan sertifikat tanah jadi dan dapat diambil.</p>\r\n\r\n<p><img alt=\"\" src=\"https://drive.google.com/file/d/16lZSJpXQPjtVY4ZlP6jPw6iJPoSuyCzo/view?usp=sharing\" />Baca juga: Begini Cara Daftar m-Banking Mandiri Lewat HP dengan Mudah Lihat Foto Biaya balik nama sertifikat tanah dan cara mengurusnya secara mandiri di kantor BPN(Dok Kementerian ATR/BPN) Biaya mengurus sertifikat tanah Dikutip dari Kontan.co.id, biaya mengurus sertifikat tanah sangat relatif terutama tergantung pada lokasi dan luasnya tanah. Semakin luas lokasi dan semakin strategis lokasinya, biaya akan semakin tinggi. Meski demikian, semua biaya diatur dalam Peraturan Pemerintah Nomor 128 Tahun 2015 tentang Jenis dan Tarif atas Jenis Penerimaan Negara Bukan Pajak yang Berlaku pada Kementerian Agraria dan Tata Ruang/Badan Pertanahan Nasional. Hal itu menjadi patokan biaya pembuatan sertifikat tanah. Adapun tarif pelayanan pengukuran dan pemetaan batas bidang tanah dihitung berdasarkan rumus berikut ini: Luas tanah sampai dengan 10 hektar: Tu = (L/500 x HSBKu ) + Rp 100.000 Luas tanah lebih dari 10 hektar sampai dengan 1.000 hektar: Tu = (L/4.000 x HSBKu ) + Rp 14.000.000 Luas tanah lebih dari 1.000 hektar Tu = (L/10.000 x HSBKu ) + Rp 134.000.000 Keterangan: Tu: tarif Pelayanan Pengukuran dan Pemetaan Bidang Tanah Dalam Rangka Penetapan Batas. L: luas tanah. HSBku: Harga Satuan Biaya Khusus kegiatan pengukuran yang berlaku untuk tahun berkenaan, untuk komponen belanja bahan dan honor yang terkait dengan keluaran (output) kegiatan. Baca juga: Simak Syarat dan Cara Pengajuan KPR BTN 2022 untuk Beli Rumah Subsidi Cara membuat sertifikat tanah melalui PPAT Apabila kamu merasa kesulitan atau bingung dengan cara membuat sertifikat tanah secara mandiri, kamu memiliki opsi untuk menggunakan jasa Pejabat Pembuat Akta Tanah (PPAT). PPAT memiliki wewenang untuk membuat dokumen autentik tentang suatu perbuatan tentang hak tanah. Berikut cara membuat sertifikat tanah melalui PPAT: Mendatangi kantor BPN Mengajukan permohonan kepada PPAT. PPAT menerima permohonan untuk balik nama pembuatan sertifikat tanah. Kemudian, PPAT akan melakukan pengubahan nama penjual dengan cara mencoret pemegang hak lama (penjual) dengan tinta hitam Selanjutnya, nama pemegang hak yang baru (pembeli) ditulis pada halaman dan kolom yang ada pada buku tanah dan sertifikat Kepala BPN atau pejabat yang berwenang akan menandatangani bagian tersebut, serta membubuhi tanggal Kemudian PPAT akan melakukan proses pembuatan sertifikat tanah ini dalam waktu sekitar 14 hari Demikianlah cara membuat sertifikat tanah (cara mengurus sertifikat tanah), baik secara mandiri maupun melalui PPAT. Upayakan agar kamu tidak menggunakan cara yang meragukan, atau bahkan memakai jasa calo. Baca juga: Simak Cara Daftar Blu BCA, Biaya Transfer Antarbank Cuma Rp 2.500<br />\r\n<br />\r\nArtikel ini telah tayang di&nbsp;<a href=\"https://www.kompas.com/\">Kompas.com</a>&nbsp;dengan judul &quot;Cara Membuat Sertifikat Tanah, Dilengkapi Syarat dan Biayanya&quot;, Klik untuk baca:&nbsp;<a href=\"https://money.kompas.com/read/2022/06/21/235826926/cara-membuat-sertifikat-tanah-dilengkapi-syarat-dan-biayanya?page=all\">https://money.kompas.com/read/2022/06/21/235826926/cara-membuat-sertifikat-tanah-dilengkapi-syarat-dan-biayanya?page=all</a>.<br />\r\nPenulis : Siti Maghfirah<br />\r\nEditor : Siti Maghfirah<br />\r\n<br />\r\nDownload aplikasi&nbsp;<a href=\"https://www.kompas.com/\">Kompas.com</a>&nbsp;untuk akses berita lebih mudah dan cepat:<br />\r\nAndroid:&nbsp;<a href=\"https://bit.ly/3g85pkA\">https://bit.ly/3g85pkA</a><br />\r\niOS:&nbsp;<a href=\"https://apple.co/3hXWJ0L\">https://apple.co/3hXWJ0L</a></p>\r\n', '9ceff7b608e98d6e75fa0fb1395309dd.jpg');
